import React from 'react'
import './App.css'
import 'bootstrap/dist/css/bootstrap.min.css'

import Content from '../components/Content/Content'
import Footer from '../components/Footer/Footer'

import UserView from '../../pages/UserView'

const App = (props) => {
    return (
        <div>
            <Content />
            <UserView />
            <Footer />
        </div>
    )
}

export default App;
